import App from './App';

import { Route, Routes, useParams} from "react-router-dom"



function Main() {
    const params = useParams();

    console.log(params)
    return (
        <Routes>
        <Route path="/1/:id" element={<App />} />
        <Route path="/2/:id" element={<App />} />   
        <Route path="/3/:id" element={<App />} />
        <Route path="/4/:id" element={<App />} />
      </Routes>
      );
  }

  export default Main;
